import logo from './logo.svg';
import './App.css';
import React from 'react';
import {
    Route,
    BrowserRouter as Router,
    Routes as Switch,
} from "react-router-dom";
import Home from './Home';

function App() {
  return (
    <Router>
      <Switch>
      <Route exact path="/" component={Home}></Route>
      </Switch>
    </Router>

  );
}

export default App;
